import { Component } from "react";
import { Link, Switch, Route } from "react-router-dom";
import DetailOne from "./Detail1";
import DetailTwo from "./Detail2";

class Regist extends Component {
  render() {
    return (
      <div className="regist">
        <h1>我是Regist组件</h1>
        <Link to="/regist/detail1">注册的子路由1</Link>
        <Link to="/regist/detail2">注册的子路由2</Link>
        <Switch>
          {/* /regist 是一级路由的地址 /detail1 是二级路由地址。 */}
          <Route path="/regist/detail1" component={DetailOne} />
          <Route path="/regist/detail2" component={DetailTwo} />
        </Switch>
      </div>
    );
  }
}

export default Regist;
